import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./style.css";
import ThemeProvider from "./contexts/ThemeContext";
import Home from "./pages/Home";
import Terms from "./pages/Terms";

function App() {
  return (
    <Router>
      <ThemeProvider>
        <Routes>
          <Route path="/" element={<Home />} /> {/* Cambiado a 'element' */}
          <Route path="/terminos" element={<Terms />} /> {/* Cambiado a 'element' */}
        </Routes>
      </ThemeProvider>
    </Router>
  );
}

export default App;
